  <script>
    Polymer({

      is: 'my-train',
      ready: function() {
        this.isready = true;
        var self = this;
        var ids = [];
        //var initialColors = [];
        var i=1;
        this.push('seats',{});

        while (this.$["seat"+i]) {
            //initialColors[i] = "#B8E986";
            ids.push("seat"+i);
            //this.push('seats',{color: "#B8E986"})
            this.seats.push({color: "#B8E986"});
            i++;
        }
      //  this.seats = i-1;
        ids.forEach(function(id) {
            self.$[id].addEventListener("click", function() {
                self.fire("seat-click", {seat: id.replace("seat","")});
            });
        });
        this.notifySplices('seats',{ index: 0, removed: [], addedCount: this.seats.length, object: this.seats, type: 'splice'})
        //this.notifyPath("seats");
      },
      properties: {
        seats: {
          type: Array,
          value: [],
          notify: true,
          reflectToAttribute: false
        }
      },
      observers: [
       'update(seats.*)'
     ],
      update: function() {
        if (!this.isready) return;

          for (i=1; i < this.seats.length; i++) {
              var fill = this.seats[i].color;
              this.$["seat"+i].setAttribute("fill",fill);
          }
      }

    });
  </script>
